import React, { useState, useEffect } from 'react';

const API_BASE_URL = 'http://220.88.39.23:5000';

const FootballDashboard = () => {
  const [token, setToken] = useState('');
  const [news, setNews] = useState([]);
  const [stats, setStats] = useState(null);
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  // 获取token的函数
  const getToken = async () => {
    try {
      setLoading(true);
      const response = await fetch(
        `${API_BASE_URL}/api/user/token?username=test&team=울산`,
        {
          method: 'GET',
        }
      );

      if (!response.ok) {
        throw new Error('Token获取失败');
      }

      const data = await response.json();
      setToken(data.token);
      localStorage.setItem('footballToken', data.token);
    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  // 获取新闻的函数
  const fetchNews = async () => {
    try {
      setLoading(true);
      const response = await fetch(`${API_BASE_URL}/api/news/all_blocks`, {
        headers: {
          'Authorization': `Bearer ${token}`
        }
      });

      if (!response.ok) {
        throw new Error('新闻获取失败');
      }

      const data = await response.json();
      setNews(data);
    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  // 获取统计数据的函数
  const fetchStats = async () => {
    try {
      setLoading(true);
      const response = await fetch(`${API_BASE_URL}/api/stats`, {
        headers: {
          'Authorization': `Bearer ${token}`
        }
      });

      if (!response.ok) {
        throw new Error('统计数据获取失败');
      }

      const data = await response.json();
      setStats(data);
    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  // 检查本地存储中的token
  useEffect(() => {
    const storedToken = localStorage.getItem('footballToken');
    if (storedToken) {
      setToken(storedToken);
    }
  }, []);

  return (
    <div className="p-4 space-y-4">
      {error && (
        <Alert variant="destructive">
          <AlertCircle className="h-4 w-4" />
          <AlertDescription>{error}</AlertDescription>
        </Alert>
      )}

      <Card>
        <CardHeader>
          <CardTitle>韩国足球数据面板</CardTitle>
        </CardHeader>
        <CardContent className="space-y-4">
          <div className="space-x-2">
            <Button 
              onClick={getToken} 
              disabled={loading}
            >
              获取Token
            </Button>
            <Button 
              onClick={fetchNews} 
              disabled={!token || loading}
            >
              获取新闻
            </Button>
            <Button 
              onClick={fetchStats} 
              disabled={!token || loading}
            >
              获取统计
            </Button>
          </div>

          {loading && <div className="text-center">加载中...</div>}

          {token && (
            <div className="p-2 bg-gray-100 rounded">
              <p className="font-mono break-all">Token: {token}</p>
            </div>
          )}

          {news.length > 0 && (
            <div className="space-y-2">
              <h3 className="text-lg font-semibold">新闻列表</h3>
              <div className="space-y-1">
                {news.map((item, index) => (
                  <div key={index} className="p-2 bg-gray-50 rounded">
                    {JSON.stringify(item)}
                  </div>
                ))}
              </div>
            </div>
          )}

          {stats && (
            <div className="space-y-2">
              <h3 className="text-lg font-semibold">统计数据</h3>
              <pre className="p-2 bg-gray-50 rounded">
                {JSON.stringify(stats, null, 2)}
              </pre>
            </div>
          )}
        </CardContent>
      </Card>
    </div>
  );
};

export default FootballDashboard;
